import './StatsSection.css';

const StatsSection: React.FC = () => {
  return (
<section className="stats-section">
        <div className="stats-grid">
          <div className='stat-self'>
<div className="stat-number" style={{ fontSize: '12rem' }}>150%</div>
<div className="stat-label" style={{ fontSize: '1.5rem' }}>Average ROI</div>
</div>

<div>
<div className="stat-number" style={{ fontSize: '12rem' }}>95%</div>
<div className="stat-label" style={{ fontSize: '1.5rem' }}>Client Retention</div>
</div>
        </div>
    </section>
  );
};

export default StatsSection;
